components.customConditional:
if(data.policyStatus && data.policyStatus != "" && data.policyStatus != "In Progress" && !data.privileges['MANAGE_ACCOUNT_MANAGER_WRITE']){
  show = true;
}else{
  show = false;
}

if(data.privileges && data.policyStatus && data.policyStatus != ""){
  show = (data.privileges['MANAGE_EXCESS_WRITE'] && !data.privileges['MANAGE_ACCOUNT_MANAGER_WRITE'] && (data.policyStatus == "Received" || data.policyStatus == "Quote Rejected")) 
}else{
  show = false;
}

if(data.privileges && data.policyStatus && data.policyStatus != ""){
  show = (data.privileges['MANAGE_EXCESS_WRITE'] && !data.privileges['MANAGE_ACCOUNT_MANAGER_WRITE'] && data.policyStatus == "UW Review") 
}else{
  show = false;
}

show = (data.genreApproval && data.genreApproval == "approveAndGenerateQuote" && data.policyStatus != "Quote Rejected")
if(data.quoteApproved && data.quoteApproved == "approved"){
  show = false;
}

components.calculateValue:
var today = moment(data['proposedPolicyStartDate']).format('YYYY-MM-DD');
var todayNew = moment(today);
var year = todayNew.year();
var ll = today.split('-');
value = (year+1) + "-" + ll[1] + "-" + ll[2];
console.log(value);

value = {};
console.log(data.documents);
if(data.documents)
{
  if(typeof data.documents === 'object'){
    value[0] = data.documents['final_policy']['file'];
  }else{
    var documents = {};
    data.documents.map(item,key => {
      documents[key] = item['final_policy']['file'];
    });
    value = documents;
  }
}

controller:
var s = document.createElement("script");
s.src = "https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js";
s.onload = function(e) {
	var appendCustomButtonTimer = setInterval(() => {
		if (
			document.getElementById(
				"formio_loader_29f8c4a2-d89c-11eb-b8bc-0242ac130003"
			)
		) {
			var dataGridDeleteIcons =
				document.getElementsByClassName("fa-times-circle-o");
			dataGridDeleteIcons = Array.from(dataGridDeleteIcons);
			if (dataGridDeleteIcons.length > 0) {
				dataGridDeleteIcons.map((item) => {
					item.classList.add("fa-times-circle");
					item.classList.remove("fa-times-circle-o");
				});
			}
		} else {
			appendCustomButtonTimer ? clearInterval(appendCustomButtonTimer) : null;
		}
	}, 1000);
};
document.head.appendChild(s);
